import { NavLink } from "react-router-dom";

export function MainNavigation() {
  const activeLinkClass =
    "font-medium text-amber-600 underline underline-offset-4";
  const inactiveLinkClass = "font-medium text-amber-500";
  return (
    <header>
      <nav>
        <ul className="flex gap-10 p-10 bg-[#121] text-base">
          <li>
            <NavLink
              to="/"
              className={({ isActive }) =>
                isActive ? activeLinkClass : inactiveLinkClass
              }
            >
              Home Page
            </NavLink>
          </li>
          <li>
            <NavLink
              to="/events"
              className={({ isActive }) =>
                isActive ? activeLinkClass : inactiveLinkClass
              }
            >
              Event
            </NavLink>
          </li>
        </ul>
      </nav>
    </header>
  );
}
